	}
	
	function	OnWin	{
		set getarg(0), getarg(0) + 1;
		if(getarg(0) == 2 )
			{
				announce "[ @wager ] : Congrats! "+strcharinfo(0)+" won the wager match",0;
				dispbottom "You have received "+(2*.ZBet)+"z from bet.";
				zeny = zeny + (2*.ZBet);
				getitem .item_bet, (2*.item_bet_amount);
