class A 
{

    int x;
 
  public:
    void Func1(){ printf("Func1( )\n"); };
    void Func2(int i)
	{ 
		
		x = i;
		
		printf("Func2(A)\n"); 
	
	};
	
	int Func4()
	{
		
	  return x;	
	}
};



///////////////////////////////////////////////////
class B: public A 
{
 
     int y;
 
   public:
     void Func2(){ printf("Func2(B)\n"); };
     void Func3()
	 { 
			
		  printf("x = %d, Func3( )\n", Func4()); 
	 };
};







////////////////////////////////////////////////////
int main()                                        // 
{

    B b;
    

    
    b.Func1();                                    //           унаследован от A
    b.Func2();                                    //  переопределена в классе B
    b.A::Func2(2);                                 //   версия Func2 из класса A
    b.Func3();                                    //      определена в классе B
}

