#include <algorithm>
#include <iostream>
#include <array>
#include <vector>
#include <numeric>
#include <random>
#include <chrono>


using namespace std;

#define int long long
#pragma comment(linker,"/STACK:1000000000,1000000000")

const long long INF = 1e9 + 7;
const int MAXN = 1e6 + 5;
const int N = 1e5 + 10;

const int M1 = 1e9 + 123;
const int M2 = 1e9 + 321;
int P1 = 22811;
int P2 = 22699;

array<int, MAXN> power1, power2;

inline void init_pow() {
    power1[0] = 1;
    power2[0] = 1;
    for (int i = 1; i < MAXN; ++i) {
        power1[i] = (1ll * power1[i - 1] * P1) % M1;
        power2[i] = (1ll * power2[i - 1] * P2) % M2;
    }
}

inline void build_hash(vector<int>& s, vector<pair<int, int>>& h) {
    int n = s.size();
    h.resize(n + 1);
    h[0].first = 0;
    h[0].second = 0;

    for (int i = 0; i < n; ++i) {
        h[i + 1].first = (h[i].first + 1ll * s[i] * power1[i]) % M1;
        h[i + 1].second = (h[i].second + 1ll * s[i] * power2[i]) % M2;
    }
}

inline pair<int, int> get_hash(vector<pair<int, int>>& h, int pos, int len, int mx_pow = 0) {
    int h1 = h[pos + len].first - h[pos].first;
    int h2 = h[pos + len].second - h[pos].second;
    if (h1 < 0) {
        h1 += M1;
    }
    if (h2 < 0) {
        h2 += M2;
    }
    if (mx_pow != 0) {
        h1 = h1 * power1[mx_pow - (pos + len - 1)] % M1;
        h2 = h2 * power2[mx_pow - (pos + len - 1)] % M2;
    }
    return make_pair(h1, h2);
}

inline bool is_equal(vector<pair<int, int>>& h_l, vector<pair<int, int>>& h_r, int start1, int start2, int len) {
    pair<int, int> d_l, d_r;
    d_l.first = ((h_l[start1 + len].first - h_l[start1].first + M1) % M1 * 1ll * power1[start2]) % M1;
    d_l.second = ((h_l[start1 + len].second - h_l[start1].second + M2) % M2 * 1ll * power2[start2]) % M2;

    d_r.first = ((h_r[start2 + len].first - h_r[start2].first + M1) % M1 * 1ll * power1[start1]) % M1;
    d_r.second = ((h_r[start2 + len].second - h_r[start2].second + M2) % M2 * 1ll * power2[start1]) % M2;

    return d_l == d_r;
}

inline int random_key(const int before, const int after) {
    auto seed = std::chrono::high_resolution_clock::now().time_since_epoch().count();
    std::mt19937 mt_rand(seed);
    int base = std::uniform_int_distribution<int>(before + 1, after)(mt_rand);
    return base;
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    P1 = random_key(256, M1);
    P2 = random_key(256, M2);

    int n, m;
    cin >> n >> m;
    vector<int> a(n), b(n);
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
        b[i] = a[i];
    }
    reverse(b.begin(), b.end());


    vector<pair<int, int>> h_a, h_b;
    init_pow();
    build_hash(a, h_a);
    build_hash(b, h_b);

    vector<int> ans = {n};
    for (int i = 1; i <= n / 2; ++i) {
        if (get_hash(h_a, 0, i, n) == get_hash(h_b, n - 2 * i, i, n)) {
            ans.emplace_back(n - i);
        }
    }
    sort(ans.begin(), ans.end());
    for (const auto& i: ans) {
        cout << i << ' ';
    }
}

///////////////////////////////////////////////////////////////////////////////////
void battery :: batteryStoreInfo(void)
{
	static uint16_t _counter=0;
	uint32_t _pageAddress=0x0801F800;
	// store battery infor while charging and discharging
	if(isBatteryInChargeMode() == 1 || isBatteryInDischargeMode() == 1)
	{
		_counter++;
		if(_counter > 500)
		{
			int64_t _data = 0;//batteryAccumulatedCharge;
			//Flash config
			uint32_t _error=0;
			FLASH_EraseInitTypeDef _pEraseInit;
			_pEraseInit.TypeErase = FLASH_TYPEERASE_PAGES;
			_pEraseInit.Page = 63;
			_pEraseInit.NbPages = 1;
			_pEraseInit.Banks = FLASH_BANK_1;

			//Flash processing
			//unlock the flash
			HAL_FLASH_Unlock();
			//erase the page going to be written
			HAL_FLASHEx_Erase(&_pEraseInit, &_error);
			// write to that page
			HAL_FLASH_Program(FLASH_TYPEPROGRAM_DOUBLEWORD, _pageAddress , _data);
			//lock the flash
			HAL_FLASH_Lock();
			_counter=0;
		}
	}
	else if(__HAL_RCC_GET_FLAG(RCC_FLAG_PWRRST) == 1)
	{
		//read from page
		//unlock the flash
		HAL_FLASH_Unlock();
		batteryAccumulatedCharge =  *((int32_t*)_pageAddress);
		//lock the flash
		HAL_FLASH_Lock();
		__HAL_RCC_CLEAR_RESET_FLAGS();
	}
}


///////////////////////////////////////////////////////////////////////////////////
int32_t battery :: batteryReadFlash(int32_t *_readStoredValue)
{
    uint32_t _pageAddress = 0x0801F800;
    // unlock the MCU Flash
    HAL_FLASH_Unlock();
	*_readStoredValue =  *((int32_t*)_pageAddress);
	//lock the MCU Flash
	HAL_FLASH_Lock();
    return *_readStoredValue;
}

import java.util.Arrays;
import java.util.Scanner;
 
public class BiggestPrimeSecond {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
 
        int n = Integer.parseInt(scanner.nextLine());
 
        Boolean[] isPrime = new Boolean[n + 1];
        Arrays.fill(isPrime, true);
 
        for (int i = 2; i < Math.sqrt(n) + 1; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j <= n; j += i) {
                    isPrime[j] = false;
                }
            }
        }
 
        for (int i = isPrime.length - 1; i > 0 ; i--) {
            if (isPrime[i]) { // not (!isPrime[i])
                System.out.println(i);
                return;
            }
        }
    }
}

